pragma solidity ^0.6.0;

contract YourContract {
    address public owner;
    address public newowner;
    string public symbol;
    string public name;
    uint8 public decimals;
    uint256 public amount_eth;
    uint8 public token_price;
    uint256 private s_7;
    mapping(address => uint256) public balanceof;
    mapping(address => mapping(address => uint256)) public allowance;

    constructor() public {
        owner = msg.sender;
        symbol = "";
        name = "";
        decimals = 18;
        amount_eth = 0;
        token_price = 10;
        // update s_7 and balances based on complex conditions here
    }

    function transfer(address _to, uint256 _value) public returns (bool success) {
        require(balanceof[msg.sender] >= _value);
        balanceof[msg.sender] -= _value;
        balanceof[_to] += _value;
        return true;
    }

    function transferFrom(address _from, address _to, uint256 _value) public returns (bool success) {
        require(_value <= balanceof[_from]);
        require(_value <= allowance[_from][msg.sender]);
        balanceof[_from] -= _value;
        balanceof[_to] += _value;
        allowance[_from][msg.sender] -= _value;
        return true;
    }

    function approve(address _spender, uint256 _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        return true;
    }

    function approveAndCall(address _spender, uint256 _value, bytes memory _extraData) public returns (bool success) {
        tokenRecipient spender = tokenRecipient(_spender);
        if (approve(_spender, _value)) {
            spender.receiveApproval(msg.sender, _value, address(this), _extraData);
            return true;
        }
    }    

    fallback() external payable {
        require(msg.value > 0);
        uint256 tokens = msg.value * token_price;
        require(tokens <= balanceof[address(this)]);
        balanceof[address(this)] -= tokens;
        balanceof[msg.sender] += tokens;
        amount_eth += msg.value;
    }

    function transferOwnership(address _newowner) public {
        require(msg.sender == owner);
        newowner = _newowner;
    }

    function acceptOwnership() public {
        require(msg.sender == newowner);
        owner = newowner;
        newowner = address(0);
    }

    function transferAnyERC20Token(address tokenAddress, uint256 tokens) public returns (bool success) {
        return ERC20Interface(tokenAddress).transfer(owner, tokens);
    }
}

interface tokenRecipient { 
    function receiveApproval(address _from, uint256 _value, address _token, bytes calldata _extraData) external; 
}

interface ERC20Interface {
    function transfer(address to, uint256 tokens) external returns (bool success);
}
